import React from "react";
import "./SearchBar.css";
import InputField from "./InputField";
import LargeButton from "./LargeButton";
function SearchBar()
{
    const visina="50px";
    return(
        <div id="searchCont">
            <InputField 
                type="text"
                width="500px"
                height={visina}
                fontSize="20px"
            />
            <LargeButton
                width="100px"
                height="100%"
                value="SEARCH"
                backgroundColor="#2d2d2d"
            />
        </div>

    );
}

export default SearchBar;
